import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useFormik } from 'formik';
import { useAuthStore } from '../store/store';
import Navbar from '../components/Nav';

export default function Admin() {
  const navigate = useNavigate();
  const [searchTerm, setSearchTerm] = useState('');
  const [filterValue, setFilterValue] = useState('');
  const [items, setItems] = useState([]);

  const handleSearch = (event) => {
    setSearchTerm(event.target.value);
    // Perform search logic based on the searchTerm
    // Update the items state with the filtered items
  };

  const handleFilter = (event) => {
    setFilterValue(event.target.value);
    // Perform filtering logic based on the filterValue
    // Update the items state with the filtered items
  };

  const handleAddItem = () => {
    // Logic for adding an item
    // Redirect or show a modal to add an item
  };

  return (
    <main>
      <Navbar />
      <m>
        <input
          type="text"
          placeholder="Search..."
          value={searchTerm}
          onChange={handleSearch}
          className="border border-gray-300 rounded-md p-2"
        />
        <button
          onClick={handleFilter}
          className="bg-blue-500 text-white px-4 py-2 rounded-md ml-2"
        >
          Filter
        </button>
        <button
          onClick={handleAddItem}
          className="bg-green-500 text-white px-4 py-2 rounded-md ml-2"
        >
          Add Item
        </button>
      </m>
      {/* Render the items */}
      <ul>
        {items.map((item) => (
          <li key={item.id}>{item.name}</li>
        ))}
      </ul>
    </main>
  );
}
